import React from 'react';
import { Container } from 'react-bootstrap'
import Body from './Body'

function App() {
  return (
    <div className="wrapper d-flex align-items-center justify-content-center"> 
      <Container fluid>
          <Body />
      </Container>
    </div>
  );
}

export default App;
